import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";

function Project(props) {
  const styles = {
    projects: {
      display: "flex",
      flexDirection: "column",
      marginLeft: "40px",
      marginBottom: "50px"
    },
    button: {
    backgroundColor: 'rgb(128, 108, 84)',

    }
  };

  return (
    <>
      <h1>Projects</h1>
      {props.challenges.map((challenge, index) => (
        <div style={styles.pro}>
          <h3 key={index}>{challenge.title}</h3>
          <img key={index} src={challenge.image}></img>
          <p key={index}>{challenge.description}</p>
          <button key={index} href={challenge.deployedURL}>
            Visit App
          </button>
          <button key={index} href={challenge.repo}>
            View GitHub Repo
          </button>
        </div>
      ))}


    </>
  );
}

export default Project;


